INSERT INTO `ability_details` VALUES (1, 1, 'information', 'Be empowered. Be inspired. ABILITY English, is an award winning English school with campuses in Sydney and Melbourne. CRICOS Provider code: 01530K\n\nMelbourne Campus: Level 3, 55 Swanston St.\nMelbourne', 'information');
INSERT INTO `ability_details` VALUES (2, 1, 'introdution', 'ABILITY English is one of the best English language providers in Australia with two campuses located in popular study destinations Sydney and Melbourne. ABILITY English is widely known for its award-winning and innovative courses (General English Plus and Survivor English) designed to suit all our students’ needs – conversation, work or academic. The courses are delivered by our communication experts and academic preparation specialists with years of experience in the industry, excellent error correction and confidence-building skills and high-level qualifications.\n\nIn addition to our courses, we offer great range of activities with the aim to help students improve their English skills. Some iconic ABILITY events include Culture Day and Film Festival.\n\nABILITY English is famous for attracting students from a wide range of countries.Each year we receive students from more than 80 different countries. Because you will be studying with students from every continent you will build a diverse network of international friends, future colleagues and contacts.\n\nWe understand that traveling to/living in another country may seem exciting but can be challenging at the same time. Therefore, students at ABILITY English receive great range of support from student services, English support and accommodation.\n\nIf you are looking for a once of a lifetime experience, come and join us at ABILITY English!', 'introdution');
INSERT INTO `ability_details` VALUES (3, 1, 'products', 'General English (Standard Option)\nGeneral English (Plus Option)\nSurvivor English\nCambridge Exam Preparation courses (PET, FCE and CAE)\nIELTS Test Preparation\nEnglish for Academic Purposes\n\nCourses are available in both DAY and EVENING timetables (please refer to our website www.ability.edu.au)\n\nPrivate Tuition available upon request\n', 'product,website');
INSERT INTO `ability_details` VALUES (4, 1, 'Public Transit', 'Both campuses are located in the heart of the CBD where public transport can be easy accessed.', 'transit');
INSERT INTO `ability_details` VALUES (5, 2, 'About', 'If you\'re a person who wants more from your life than you\'ve been led to believe is possible, the Age of Ability will empower you to take responsibility, imagine the unimaginable and life a life that sets your soul on fire!', 'about');
INSERT INTO `ability_details` VALUES (6, 2, 'Biography', 'Our vision is to use collective experience to transform the way people perceive their limitations and inspire them to live an extraordinary life. On this page we\'ll share our stories and invite you to share yours. We will introduce you to the principles of mindset training, to empower you to move forward in your life\'s journey', 'Biography');
INSERT INTO `ability_details` VALUES (7, 4, 'About', 'By focusing on the individual, Ability Options assist people to enhance their lifestyle and achieve their goals.', 'about');
INSERT INTO `ability_details` VALUES (8, 4, 'introdution', 'We are one of the longest running not-for-profit organisations in NSW. We provide increased opportunities for people to live the life they choose with the support that suits them best.\n\nThese opportunities include, assistance to find employment, providing accommodation, respite and drop in living support, assisting people to access activities that interest them and linking people to their chosen community, offering advice and support about services available, providing after school and vacation care activities for teenagers with disability and helping young people make the transition from school to work.', 'introdution');
INSERT INTO `ability_details` VALUES (9, 4, ' Founding Date', '1976', 'date');
INSERT INTO `ability_details` VALUES (10, 4, 'Products', 'You can connect with us on:\nTwitter: https://twitter.com/AbilityOptions\nYouTube: https://www.youtube.com/user/abilityoptions\n', 'website,product');
INSERT INTO `ability_details` VALUES (11, 5, 'install', 'Select the operating system on which you are installing Flutter:\n\nWindows, MacOS, Linux', 'widnows,macos,linux');
INSERT INTO `ability_details` VALUES (12, 5, 'Install Android Studio', 'Android Studio offers a complete, integrated IDE experience for Flutter.\n\nAndroid Studio, version 3.0 or later\nAlternatively, you can also use IntelliJ:\n\nIntelliJ IDEA Community, version 2017.1 or later\nIntelliJ IDEA Ultimate, version 2017.1 or later\n', 'android');
INSERT INTO `ability_details` VALUES (13, 5, 'Install the Flutter and Dart plugins', 'To install these:\n\nStart Android Studio.\nOpen plugin preferences (Preferences > Plugins on macOS, File > Settings > Plugins on Windows & Linux).\nSelect Browse repositories, select the Flutter plugin and click Install.\nClick Yes when prompted to install the Dart plugin.\nClick Restart when prompted.\n', 'flutter,dart,plugin');
INSERT INTO `ability_details` VALUES (14, 5, 'Test drive', 'This page describes how to create a new Flutter app from templates, run it, and experience “hot reload” after you make changes to the app.\n\nSelect your development tool of choice for writing, building, and running Flutter apps.', 'test,android');
INSERT INTO `ability_details` VALUES (15, 5, 'Write your first Flutter app, part 1', 'his is a guide to creating your first Flutter app. If you are familiar with object-oriented code and basic programming concepts such as variables, loops, and conditionals, you can complete this tutorial. You don’t need previous experience with Dart, mobile, or web programming.\n\nThis guide is part 1 of a two-part codelab. You can find part 2 on Google Developers. Part 1 can also be found on Google Developers.', '');
INSERT INTO `ability_details` VALUES (16, 6, 'The Dart type system', 'The Dart language is type safe: it uses a combination of static type checking and runtime checks to ensure that a variable’s value always matches the variable’s static type. Although types are mandatory, type annotations are optional because of type inference.\n\nThis page concentrates on the type safety features added in Dart 2. For a full introduction to the Dart language, including types, see the language tour.', 'dart');
INSERT INTO `ability_details` VALUES (17, 6, 'Effective Dart', 'Over the past several years, we’ve written a ton of Dart code and learned a lot about what works well and what doesn’t. We’re sharing this with you so you can write consistent, robust, fast code too. There are two overarching themes:\n\nBe consistent. When it comes to things like formatting, and casing, arguments about which is better are subjective and impossible to resolve. What we do know is that being consistent is objectively helpful.\n\nIf two pieces of code look different it should be because they are different in some meaningful way. When a bit of code stands out and catches your eye, it should do so for a useful reason.\n\nBe brief. Dart was designed to be familiar, so it inherits many of the same statements and expressions as C, Java, JavaScript and other languages. But we created Dart because there is a lot of room to improve on what those languages offer. We added a bunch of features, from string interpolation to initializing formals, to help you express your intent more simply and easily.\n\nIf there are multiple ways to say something, you should generally pick the most concise one. This is not to say you should code golf yourself into cramming a whole program into a single line. The goal is code that is economical, not dense.\n\nThe Dart analyzer has a linter to help you write good, consistent code. If a linter rule exists that can help you follow a guideline, then the guideline links to that rule. Here’s an example:\n\nLinter rule: prefer_collection_literals\n\nFor help on enabling linter rules, see the documentation for customizing static analysis.\n\nThe guides\nWe split the guidelines into a few separate pages for easy digestion:\n\nStyle Guide – This defines the rules for laying out and organizing code, or at least the parts that dartfmt doesn’t handle for you. The style guide also specifies how identifiers are formatted: camelCase, using_underscores, etc.\n\nDocumentation Guide – This tells you everything you need to know about what goes inside comments. Both doc comments and regular, run-of-the-mill code comments.\n\nUsage Guide – This teaches you how to make the best use of language features to implement behavior. If it’s in a statement or expression, it’s covered here.\n\nDesign Guide – This is the softest guide, but the one with the widest scope. It covers what we’ve learned about designing consistent, usable APIs for libraries. If it’s in a type signature or declaration, this goes over it.\n\nFor links to all the guidelines, see the summary.\n\n\n', 'effective,dart');
INSERT INTO `ability_details` VALUES (18, 7, 'DEVELOP ACROSS ALL PLATFORMS', 'Learn one way to build applications with Angular and reuse your code and abilities to build apps for any deployment target. For web, mobile web, native mobile and native desktop.', 'platform');
INSERT INTO `ability_details` VALUES (19, 7, 'SPEED & PERFORMANCE', 'Achieve the maximum speed possible on the Web Platform today, and take it further, via Web Workers and server-side rendering.\n\nAngular puts you in control over scalability. Meet huge data requirements by building data models on RxJS, Immutable.js or another push-model.', 'speed,performance');
INSERT INTO `ability_details` VALUES (20, 7, 'INCREDIBLE TOOLING', 'Build features quickly with simple, declarative templates. Extend the template language with your own components and use a wide array of existing components. Get immediate Angular-specific help and feedback with nearly every IDE and editor. All this comes together so you can focus on building amazing apps rather than trying to make the code work.', 'tooling');
INSERT INTO `ability_details` VALUES (21, 7, 'LOVED BY MILLIONS', 'From prototype through global deployment, Angular delivers the productivity and scalable infrastructure that supports Google\'s largest applications', '');
INSERT INTO `ability_details` VALUES (22, 9, 'downloading...', 'The latest version of OpenCart (v.3.0.2.0) can be downloaded from the OpenCart website (recommended for end user) or directly from github (recommended for web developer). The download page also offers access to previous versions of OpenCart. Under the Downloads column, locate 3.0.2.0 and press the \"Download Now\" link directly across from it under the Action column. This will download the compressed archive of that version of OpenCart in a zip file. For OpenCart version 3.0.2.0, a file named \"3.0.2.0-compiled.zip\" will be downloaded.\n\n\ngood.\nthanks.\n', 'opencart');
INSERT INTO `ability_details` VALUES (23, 9, 'uploading opencart', 'At this step you should have a web server established and the OpenCart archive extracted. We will now use File Transfer Protocol (FTP) client to upload these uncompressed files to a web server.', 'FTP,configure');
INSERT INTO `ability_details` VALUES (24, 9, 'connecting to the site Manager', 'Under the “File” menu, “Site Manager” should be opened in Filezilla. A window will pop up with the General tab open. You should fill in the information gathered above regarding hosting information, and press “Connect”. The right “Remote Site” side will now display the file directory of your website.', 'php');
INSERT INTO `ability_details` VALUES (25, 9, 'uploading opencart\'s files', 'If you haven\'t already located the OpenCart upload folder on the left side, you need to do so now and keep it open. In the Remote Site directory (right side), you need to open the folder that the OpenCart shop will be located in. The location of shop varies based on whether the you want the shop to be seen on the main page, a sub-folder, a subdomain, etc. If you want to make OpenCart the main page, you would need to upload files to the root folder of their website.\n\nBravo...', 'file,manager');

